const schema = `datasource db {
    provider = "mysql"
    url      = env("DATABASE_URL")
    // url      = "mysql://neulhan1:gksruf@15.165.21.100:3306/neulhanDB"
    // url      = "mysql://neulhan:gksruf@localhost:3306/neulhanDB"
}

generator db {
    provider = "go run github.com/prisma/prisma-client-go"
    output   = "./db/db_gen.go"
    package  = "db"
}

model User {
    id        String   @default(cuid()) @id
    createdAt DateTime @default(now())
    email     String   @unique
    name      String?
    age       Int?
    password  String?
    posts     Post[]
}

model Post {
    id        String   @default(cuid()) @id
    createdAt DateTime @default(now())
    updatedAt DateTime @updatedAt
    title     String
    content   String

    author   User    @relation(fields: [authorID], references: [id])
    authorID String
    images   Image[]
}

model Image {
    id     String @default(cuid()) @id
    name   String
    url    String
    post   Post   @relation(fields: [postID], references: [id])
    postID String
}
`

// hasBinaryTargets is true when binaryTargets are provided on generation time
var hasBinaryTargets = false

// NewClient creates a new Prisma Client Go client.
// The client is not connected to the Prisma engine yet.
//
// Example:
//
//   client := db.NewClient()
//   err := client.Connect()
//   if err != nil {
//     handle(err)
//   }
//
//   defer func() {
//     err := client.Disconnect()
//     if err != nil {
//       panic(fmt.Errorf("could not disconnect: %w", err))
//     }
//   }()
func NewClient() *PrismaClient {
	c := &PrismaClient{}

	c.Engine = engine.NewEngine(schema, hasBinaryTargets)
	c.User = userActions{client: c}
	c.Post = postActions{client: c}
	c.Image = imageActions{client: c}

	c.Actions = &raw.Actions{Client: c}

	return c
}

// PrismaClient is the instance of the Prisma Client Go client.
type PrismaClient struct {
	// engine spawns and manages the binary
	*engine.Engine

	*raw.Actions

	// User provides access to CRUD methods.
	User userActions
	// Post provides access to CRUD methods.
	Post postActions
	// Image provides access to CRUD methods.
	Image imageActions
}

